import React, { Component } from "react";

import Node from "./Node";

export default class AVLTree extends Component {
    constructor(props) {
        super(props);
        this.state = {
            root: {}
        }
    }

    insert(root, val) {
        if (root === null) {
            root = Node(value=val);
            return root;
        }
    }
}
